    public static String maxValue(String n, int x) {
        char c = n.charAt(0);

        if(c == '-'){

            int i=1;

            while(i < n.length()){
                char ch = n.charAt(i);
                if(x < (ch-'0')){
                    return n.substring(0,i)+x+n.substring(i);
                }
                i++;
            }

        }else{
            int i=0;

            while(i < n.length()){
                char ch = n.charAt(i);
                if(x > (ch-'0')){
                   return n.substring(0,i)+x+n.substring(i);
                }
                i++;
            }
        }
       return n+x;
    }
